import React from 'react';
import { Autocomplete } from 'components';
import { withKnobs, text, array } from '@storybook/addon-knobs';
import { Box } from '@material-ui/core';
import { mockClasses } from 'setupMocks';

export default {
  title: 'Autocomplete',
  component: Autocomplete,
  decorators: [withKnobs],
};

export const Default = () => {
  const label = text('Label', 'My Autocomplete');
  const helperText = text('HelperText', 'Helper Text 1');
  const handleUpdate = () => alert('updated');
  const suggestionsLable = text('SuggestionsLabel', 'default');
  const suggestionValue = text('SuggestionsValue', 'default');
  const arraySuggestions = [
    { label: 'foo', value: 'foo' },
    { label: 'bar', value: 'bar' },
    { label: suggestionsLable, value: suggestionValue },
  ];
  const defaultValue = arraySuggestions[0];
  const suggestions = array('suggestions', arraySuggestions);

  return (
    <Box>
      <Autocomplete
        id={text('Id', '123')}
        optionKey={text('Option Key', 'optionkey1')}
        label={label}
        suggestions={suggestions}
        helperText={helperText}
        handleUpdate={handleUpdate}
        classes={mockClasses}
        optionLabel={text('Option Label', 'optionLabel1')}
      ></Autocomplete>
    </Box>
  );
};
